class Solution {
    func minSizeSubarray(_ nums: [Int], _ target: Int) -> Int {
        var prefixSum = [0]
        var sum = 0
        var result = Int.max

        for num in nums {
            sum += num
            prefixSum.append(sum)
        }

        if sum == 0 {
            return -1
        }

        var totalSum = 0
        for i in 0..<prefixSum.count {
            totalSum += prefixSum.last!
            var targetSum = target + totalSum - prefixSum[i]

            var left = i
            var right = prefixSum.count - 1
            while left <= right {
                let mid = left + (right - left) / 2
                if prefixSum[mid] < targetSum {
                    left = mid + 1
                } else {
                    right = mid - 1
                }
            }

            if left < prefixSum.count {
                result = min(result, left - i + (targetSum - totalSum) / sum * nums.count)
            }

            if targetSum % sum == 0 {
                break
            }
        }

        return result == Int.max ? -1 : result
    }
}
